import BillBoards from "../BillBoards/BillBoards"


const Home = ({movieUpComing}) => {
  
  const renderMovies = movieUpComing.map((movie)=>{
    return (
        <div  key={movie.id}>
        <h1>{movie.title}</h1>
        <img src={getPosterUrl(movie.poster_path)} alt={movie.original_title} />
    </div>
    )
  })
  
  
  return (
    <div>
      <renderMovies/>
    </div>
  )
}

export default Home
